import './App.css';
import { AiOutlineLeft } from 'react-icons/ai';
import TopBar from './TopBar';

function App() {
  return (
      <body>
        <div>
        <TopBar />
        </div>

        <p color="black">채팅창</p>
        <div className="bottomBar">
          <input type="text" placeholder="채팅을 입력해주세요"></input>
        </div>
      </body>
  );
}

export default App;
